    "2013-03-15T23:25:02.101487",nt"name": "shallow-subsurface-temperatures-at-selected-locations-in-delaware",nt"isopen":
    false,nt"url": null,nt"notes": "Report of investigations on subsurface
    temperatures that were measured in instrumented borehole for about one and one-half
    years at four locations in Delaware. Subsurface temperatures were measured in instrumentednboreholes
    for about one and one-half years at depths down to 10 feet below land surface at
    four locations in the State. In New Castle County, temperatures were measured periodically
    in the field about twice a month at three sites, and, in Sussex County, they were
    automatically recorded every 15 minutes at one site. The depths of interest are
    generally in the unsaturated zone and are subject to both daily temperature fluctuations
    and longer seasonal changes. The magnitude and phase of change in relation to surface
    temperatures depend on the type of material and the depth. The difference in temperature
    extremes between 4 and 10 feet below land surface may be as much as 8 0 - 10 0 F.
    At 10 feet temperatures reflect mostly the seasonal trend.",nt"license_title":
